import React from "react";

const UserMenu = ({ user }) => {
  return (
    <div className="mmenu">
      <div className="mmen_header hover3">
        <img src={user?.picture} alt="" />
        <div className="mmenu_col">
          <span>{user?.first_name}</span>
        </div>
      </div>
    </div>
  );
};

export default UserMenu;
